import React from 'react';
import './Navbar.css';

function Navbar() {
  const handleScroll = (id) => {
    const section = document.getElementById(id);
    if (section) {
      section.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <nav>
      <ul>
        <li>
          <a href="#about" onClick={() => handleScroll('about')}>About</a>
        </li>
        <li>
          <a href="#education" onClick={() => handleScroll('education')}>Education</a>
        </li>
        <li>
          <a href="#project" onClick={() => handleScroll('project')}>Projects</a>
        </li>
        <li>
          <a href="#connect" onClick={() => handleScroll('connect')}>Connect</a>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
